#!/usr/bin/ruby

input = <<EOS





EOS

input = input.split

# Key pad is ordered so that UP increments the y-index thus making the
# algorithm clearer
keypad = [
  [nil, nil, 'D', nil, nil],
  [nil, 'A', 'B', 'C', nil],
  [ 5,   6,   7,   8,   9 ],
  [nil,  2,   3,   4,  nil],
  [nil, nil,  1,  nil, nil],
]

# We start at '5'
x = 0
y = 2

# For each digit in the PIN
input.each do |i|
  # For each character in the code move in the specifed direction
  # The movement is bounded to (0..4).  Additionally we only move
  # if the target key is not nil
  i.each_char do |c|
    case c
    when "U"
      yt = [y+1, 4].min
      y = yt if keypad[yt][x]
    when 'D'
      yt = [y-1, 0].max
      y = yt if keypad[yt][x]
    when 'R'
      xt = [x+1, 4].min
      x = xt if keypad[y][xt]
    when 'L'
      xt = [x-1, 0].max
      x = xt if keypad[y][xt]
    end
  end
  puts keypad[y][x]
end
